    return (
    <div id="cart">
      <table id='tbl'>
        {props.cart.map((item,i)=>{
            return 
                <tr>
                    <td>{item.name}</td>
                    <td>{item.price}</td>
                    <td><input className='num' type='number'/></td>
                    <td><button id='btnDel'>X</button></td>
                </tr>

        })}
        </table>
    </div>
  )
}
